// import "./styles.css";
import "antd/dist/antd.css";

// import { Layout, Menu, Breadcrumb, Row, Col } from "antd";
// import FormSizeDemo from "./Form";
// import Hero from "./Hero";
// import { Typography, List, Card } from "antd";

// const { Title } = Typography;

// const { Header, Footer, Content } = Layout;

import Form from "./Form"
import CardGrid from "./Hero"

export default function App() {
  return (
    <div>
      <nav className="navbar navbar-light bg-primary">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">
            <span className="p-5">
              <img
                src="http://www.sendnspend.com/assets/images/logo.png"
                alt="SendNSpend"
                width="67"
                height="25"
                className="d-inline-block align-text-top"
              />
            </span>
          </a>
        </div>
      </nav>

      <div className="container">
        <div className="row">
          <div className="col  mx-auto my-2 ">
            <h5>Choose your card program to get started</h5>
            <CardGrid/>
          </div>
          <div className="col p-5 m-5 bg-light">
            <Form />
          </div>
        </div>
        <div className="row"></div>
      </div>
    </div>
  );
}
